using Algorithms.Interface;
using System;
using System.Collections.Generic;
using System.Text;

namespace Algorithms.RecursionAndBacktracking
{
    public class RecursiveDigitSum : IAlgorithm
    {
        public void Execute()
        {
            string n = "";
            int k = 100000;
            long sum = 0;
            for (int i = 0; i < n.Length; i++)
            {
                sum += Int32.Parse(n[i].ToString());
            }
            sum = sum * k;
            Console.WriteLine(calc(sum));
            Console.Read();
        }

        private static long calc(long num)
        {

            if (num < 10 && num >= 0) return num;
            long sum = 0;
            while (num > 0)
            {

                sum += num % 10;
                num /= 10;


            }
            return calc(sum);

        }
    }
}
